import React from 'react'
import '../style/card.css'

function Card(props) {
  return (
    <div>
        <h1>{props.sName}</h1>
        <p>{`* ${props.sType} available`}</p>
        <p>{props.sLoc}</p>
    </div>
  )
}

export default Card
